import ExpenseItem from "./components/Expenses/ExpenseItem";

const Expenses = data.map((ele) => {
    return (
      <div>
        <ExpenseItem
          key={ele.id}
          title={ele.title}
          location={ele.location}
          date={ele.date}
          amount={ele.amount}
        />
      </div>
    );
  })

  export default Expenses;
